                <div className="col-md-9 resumeText">
                <h1 className="Email">diego.resendez@gmail.com</h1>
                <h1 className="Address">633 West Mercer Place Unit-B Seattle, WA 98119</h1>
                <h1 className="Phone">(425) 466-9803</h1>

                    <h3>Contact Information</h3>
                    <h5>Work Experience</h5>
                </div>
            </div>
        )
      }
    }
    
    export default Resume;
